import React from 'react';
import '../style/nav.css';
const nav = () => {
  return (
    <div>
      <nav >
        <ul>
          <li><a href="/">Home</a></li>
          <li><a href="#About">About</a></li>
          <li>        <a>Applier</a>
          </li>
          <li><a href="/SignIn">SignIn/SignUp</a></li>
          <li><a href="#Services">Services</a></li>
        </ul>
      </nav>
    </div>

  )
}

export default nav
